export const m164581 = {"id":164581,"title":{"romaji":"Koi yori Aoku","english":null},"description":"The long-awaited serialized version of the popular one-shot. Takamine, who can't find something she likes, and Sakura, who loves books, meet by chance and begin spending time together after school. Are they just friends, or is there something more...? Where is the story of their relationship going to lead?","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx164581-3eb38bxcLucC.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx164581-3eb38bxcLucC.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx164581-3eb38bxcLucC.jpg","color":null},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/164581/","mal":"https://myanimelist.net/manga/162601/"};
