export const m108070 = {"id":108070,"title":{"romaji":"Fuzoroi no Renri","english":"Assorted Entanglements"},"description":"Tanaka Iori is a worker for a company that sets unreasonable demands, on top of that she has a penchant for dating married men. What a recipe for disaster! One day she gets drunk with an acquaintance and wakes up the next morning by her side naked! What's Iori to do?<br><br>\n<i>Note: Nominated for the Tsugimanga 2020 Award in the Web Manga Category.<br>\n<br>\n<i>Note: Originally self-published on the author's Twitter and Pixiv, all the aforementioned and future episodes have been collected and published as commercial volumes by Kadokawa.\n</i>","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx108070-3GnX9L4fikHG.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx108070-3GnX9L4fikHG.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx108070-3GnX9L4fikHG.jpg","color":"#f1c9a1"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/108070/","mal":"https://myanimelist.net/manga/118102/"};
export const m110826 = {"id":110826,"title":{"romaji":"Egao no Taenai Shokuba Desu.","english":null},"description":"New shoujo manga artist Nana Futami works hard every day while being supported by Kaede Satou, her female editor who is older than her, and Mizuki Hazama, her assistant. According to the girl herself, she sometimes drums up intense daydream delusions of occupational illness! A working girls comedy set in the entertainment industry, brought to you by an author who always draws various girls.\n","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx110826-VgsDQWVyUWUS.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx110826-VgsDQWVyUWUS.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx110826-VgsDQWVyUWUS.jpg","color":"#f15da1"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/110826/","mal":"https://myanimelist.net/manga/123086/"};
