export const m126292 = {"id":126292,"title":{"romaji":"Onna Tomodachi to Kekkon Shite Mita.","english":"I Married My Female Friend"},"description":"Kurumi and Ruriko made a deal: if they were both single in five years, they would marry each other. Five years later, neither woman is attached, so it’s time for a wedding! Marriage is full of firsts, especially for two friends, so they have a lot to learn about each other in their newly shared home. But will they continue this arrangement like two especially close roommates…or will a different kind of love bloom between them?\n<br><br>\n(Source: Seven Seas Entertainment)","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx126292-Eb07hNWKihKy.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx126292-Eb07hNWKihKy.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx126292-Eb07hNWKihKy.jpg","color":"#e4e45d"},"chapters":32,"volumes":4,"anilist":"https://anilist.co/manga/126292/","mal":"https://myanimelist.net/manga/131607/"};
export const m98777 = {"id":98777,"title":{"romaji":"Yamada to Kase-san.","english":"Kase-san and Yamada"},"description":"Yamada is in heaven at her school’s horticulture department, and Kase-san is training hard at the sports university. With classes and a long train ride to keep them apart, hanging out together is tough. Can they beat their busy schedules and find time for one another?\n<br><br>\n(Source: Seven Seas Entertainment)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx98777-VTc0WwZmoOcM.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx98777-VTc0WwZmoOcM.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx98777-VTc0WwZmoOcM.jpg","color":null},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/98777/","mal":"https://myanimelist.net/manga/143990/"};
export const m86244 = {"id":86244,"title":{"romaji":"Futaribeya","english":"Futaribeya: A Room for Two"},"description":"About to start her first year of high school, Sakurako Kawawa settles into her new lodgings. But when she meets her new roommate -- the beautiful Kasumi Yamabuki -- everything changes! From day one the responsible, level-headed Sakurako and lazy, easygoing Kasumi find themselves at odds with one another, but with their matching mugs and one bed to share, Sakurako and Kasumi's friendship is just beginning! \n<br><br>(Source: Tokyopop)\n<br><br>\nNote: Includes 38 extra chapters.","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx86244-71LMgCWxIVd4.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx86244-71LMgCWxIVd4.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx86244-71LMgCWxIVd4.jpg","color":null},"chapters":130,"volumes":10,"anilist":"https://anilist.co/manga/86244/","mal":"https://myanimelist.net/manga/88489/"};
