export const m103081 = {"id":103081,"title":{"romaji":"Tsurezure Biyori","english":"Our Wonderful Days"},"description":"On the first day of high school, Koharu is struck speechless at the sight of the beautiful new transfer student, Mafuyu. It turns out that Mafuyu and Koharu have a deep connection, one going all the way back to their childhood. As the two friends reconnect, their feelings start to grow into love. This sweet love story that first gained popularity on Pixiv is now a series!<br><br>\n(Source: Seven Seas Entertainment)\n<br><br>\n<i>Note: Chapter count includes 3 extra omake chapters.</i>","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/nx103081-EotFFAQTgLeO.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/nx103081-EotFFAQTgLeO.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/nx103081-EotFFAQTgLeO.jpg","color":null},"chapters":21,"volumes":3,"anilist":"https://anilist.co/manga/103081/","mal":"https://myanimelist.net/manga/110292/"};
