export const m99019 = {"id":99019,"title":{"romaji":"Watashi no Kawaii Koneko-chan","english":"My Cute Little Kitten"},"description":"Rena and Yuna have been roommates since school, and decided to rent a place together after graduation. They’ve lived together as friends for five years, but things suddenly change the day Yuna adopts a kitten, even though their apartment doesn’t allow pets. When Yuna says she wants to move somewhere that will allow them to keep the kitten, Rena admits her true feelings: she wants to be more than friends. Yuna isn’t sure how to reciprocate, but she’s game to try!\n<br><br>\n(Source: Seven Seas Entertainment)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx99019-UZaYrv4xGpVt.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx99019-UZaYrv4xGpVt.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx99019-UZaYrv4xGpVt.jpg","color":"#e4bb86"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/99019/","mal":"https://myanimelist.net/manga/109522/"};
export const m120761 = {"id":120761,"title":{"romaji":"KiraKira★Study: Zettai Goukaku Sengen","english":null},"description":"Misaki Marei is a second year in high school, and she sucks at studying. She has no real goals in life, and has zero interest in taking the college entrance exam...until her childhood best friend, Micchan, says she's going to college. Now Marei has found her goal: pass the entrance exam for Akamon University, an elite college, and go to school with Micchan.\n","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx120761-elxKH6yu5aoq.png","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx120761-elxKH6yu5aoq.png","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx120761-elxKH6yu5aoq.png","color":"#f1d650"},"chapters":38,"volumes":3,"anilist":"https://anilist.co/manga/120761/","mal":"https://myanimelist.net/manga/108733/"};
export const m136774 = {"id":136774,"title":{"romaji":"Kimi to Shiranai Natsu ni Naru","english":"Throw Away the Suit Together"},"description":"Haru and Hii-chan are two young women in college buckling under the weight of adult responsibilities. Getting into university, then job hunting, then preparing for careers after graduation–it’s what they’re expected to do, because that’s what “everyone” does, but what do they really want for themselves? Finally, Haru and Hii-chan decide to take life into their own hands, toss their resumes into the sea, and move to an island together! They soon find that island living isn’t all blue skies and breezing through sunny days…but whatever the future holds, they can face it together.\n<br><br>\n(Source: Seven Seas Entertainment)\n<br><br>\n<i>Note: Includes 3 extra chapters.</i>","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx136774-AQRT7gDS86Xk.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx136774-AQRT7gDS86Xk.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx136774-AQRT7gDS86Xk.jpg","color":"#50bbe4"},"chapters":19,"volumes":3,"anilist":"https://anilist.co/manga/136774/","mal":"https://myanimelist.net/manga/142042/"};
export const m148311 = {"id":148311,"title":{"romaji":"Doushitara Osananajimi no Kanojo ni Naremasu ka!?","english":"How Do I Turn My Best Friend Into My Girlfriend?"},"description":"Minami and Yuzu have been inseparable since elementary school. But now that they’re in high school, Minami just can’t accept that Yuzu may someday get a boyfriend. How come some random guy gets to wake her up in the morning, feed her lunch, take baths with her…? It doesn’t take long for Minami to realize that her feelings can’t quite be described as “friendship” anymore, but how can she get Yuzu to see her the same way?<br><br>(Source: Seven Seas Entertainment)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx148311-XwldLGlT6RFF.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx148311-XwldLGlT6RFF.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx148311-XwldLGlT6RFF.jpg","color":null},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/148311/","mal":"https://myanimelist.net/manga/146324/"};
export const m104401 = {"id":104401,"title":{"romaji":"Yuri Moyou: Sakimiya 4-shimai no Koi","english":null},"description":"The four Sakimiya sisters all have their own love lives to deal with when it comes to being in love with other women. The eldest Ryou is dating her student Hikari, the second sister Serina has feelings for one of her coworkers, the third sister Yuika likes her childhood friend Miu, and the fourth sister Mizuki is going out with Tachibana, her teammate on the basketball team.\n<br><br>\n<i>Chapter count includes two extras.</i>","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx104401-dOYp2OPTt1m2.png","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx104401-dOYp2OPTt1m2.png","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx104401-dOYp2OPTt1m2.png","color":null},"chapters":42,"volumes":2,"anilist":"https://anilist.co/manga/104401/","mal":"https://myanimelist.net/manga/115891/"};
