export const m158904 = {"id":158904,"title":{"romaji":"Koharu to Minato","english":null},"description":"A sweet essay by a real-life couple, that attracted a lot of attention on SNS, is now being serialized on Yuri-Hime!<BR>\nKoharu and Minato are a long-distance couple who finally got the chance to live together.\nTheir lovey-dovey daily life, even with a 10-year age difference, will heal you from the fatigue of modern life...!\n<BR><BR>\n(Source: Ichijin Plus, translated)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx158904-DUxZPhmvGPU4.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx158904-DUxZPhmvGPU4.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx158904-DUxZPhmvGPU4.jpg","color":"#f1bb5d"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/158904/","mal":"https://myanimelist.net/manga/171297/"};
