export const m139399 = {"id":139399,"title":{"romaji":"Amae Sasete Hinamori-san!","english":"Spoil Me Plzzz, Hinamori-san!"},"description":"Ichigo Hinamori has always looked up to her senpai Yaya Suou for her poise, impeccable grades, and kind heart. But that all changes the day Ichigo stumbles upon Yaya wailing like a little kid in the nurse’s office. It turns out everyone’s favorite honor student is desperate to get off her pedestal and be spoiled rotten instead—and now she’s hoping Ichigo will be the one to indulge her!\n<BR><BR>\n(Source: Kodansha USA)","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx139399-FWwdEpGYln1y.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx139399-FWwdEpGYln1y.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx139399-FWwdEpGYln1y.jpg","color":"#f1e450"},"chapters":21,"volumes":3,"anilist":"https://anilist.co/manga/139399/","mal":"https://myanimelist.net/manga/140466/"};
