export const m112331 = {"id":112331,"title":{"romaji":"Tsun Hime-sama to Dame Ouji-chan","english":null},"description":"A certain school has an elegant girl known as Hime (princess), and another girl so handsome she's known as Ouji (prince). They live their school life always following these roles, but in reality these girls are nothing like their names, with one having a bad temper and one always crying. Can they fool their classmates?","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx112331-kUY0d9dSoCnn.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx112331-kUY0d9dSoCnn.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx112331-kUY0d9dSoCnn.jpg","color":"#fff100"},"chapters":24,"volumes":2,"anilist":"https://anilist.co/manga/112331/","mal":"https://myanimelist.net/manga/141688/"};
export const m155072 = {"id":155072,"title":{"romaji":"Sakuma Junsa to Hanaoka Junsa wa Tsukiai Hajimeta","english":null},"description":"Officers Ruru Sakuma (senior) and Shiori Hanaoka (junior) work together at the Minami Akihabara Koban. They were curious about each other's lives, until one day, by chance, they decided to start dating! This is a story of daily life in Akiba between two people who are gently trying their best, both in their daily duties as police officers and in their love for each other!\n<BR><BR>\n(Source: Dengeki Comic Regulus, translated)\n<br><br>\n<I>Note: Includes 2 extra chapters.</I>","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx155072-M7dpWqOqpHdw.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx155072-M7dpWqOqpHdw.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx155072-M7dpWqOqpHdw.jpg","color":"#f1e428"},"chapters":18,"volumes":2,"anilist":"https://anilist.co/manga/155072/","mal":"https://myanimelist.net/manga/154269/"};
