export const m169254 = {"id":169254,"title":{"romaji":"Shino to Ren","english":null},"description":"\"You are mine.\"\n<BR><BR>\nThe quiet and gentle Shino and the lively tomboy Ren are lovers.\nThe sweet but slightly naughty time they spend together at school, at home, and on the road, shared just between the two of them.\n<BR><BR>\nThe volume includes full-color illustrations and over 100 pages of newly drawn art.\nThe flirtatious love story between the yuri-couple Shino and Ren-chan, a hot topic on SNS, has finally been collected for commercial publication!\n<BR><BR>\n(Source: Kadokawa, translated)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx169254-9oPq4p0tbTwT.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx169254-9oPq4p0tbTwT.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx169254-9oPq4p0tbTwT.jpg","color":null},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/169254/","mal":"https://myanimelist.net/manga/162647/"};
