export const m111168 = {"id":111168,"title":{"romaji":"Ikemen Girl to Hakoiri Musume","english":"Handsome Girl and Sheltered Girl"},"description":"When Okuma Satomi's friend seeks her help wrangling guys for a crossdressing cafe, Satomi winds up with a boyfriend! Sort of. After asking her handsome and aloof classmate, Kanda Mizuki, to help out in the cafe, Mizuki agrees, but on one condition: the two of them must go on a date. Satomi eagerly agrees, delighted to have such a good-looking guy interested in her, but Mizuki realizes that Satomi has completely misunderstood something crucial: Mizuki is a girl! Will this case of mistaken identity blossom into something beautiful, or will the truth leave both girls brokenhearted?\n<br><br>\n(Source: Seven Seas Entertainment)\n<BR><BR>\n<I>Note: Chapter count includes five bonus chapters.</i>","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx111168-W4IVZKIGxXr9.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx111168-W4IVZKIGxXr9.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx111168-W4IVZKIGxXr9.jpg","color":"#e4a15d"},"chapters":18,"volumes":2,"anilist":"https://anilist.co/manga/111168/","mal":"https://myanimelist.net/manga/122672/"};
export const m184565 = {"id":184565,"title":{"romaji":"Yume to Koi dewa Tsuriawanai","english":null},"description":"\"I like you, now please reject me!\"\n<BR><BR>\nHikaru Kurata, a diligent girl who dreams of good grades leading to a good job, falls in love at first sight with Kira Kairi, another girl in her class, on their first day of high school.\nHikaru is so infatuated with her first love that she can't stop thinking about Kira all day, and her grades, which were at the top of the class when she started high school, drops to the point where she is on the verge of failing. So Hikaru boldly confesses her love to Kairi, hoping to get rejected so she could get back to studying. But Kairi's answer is very different from what she expected…\n<BR><BR>\n(Source: Yuri-Hime, translated)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx184565-AgsRIIkeNVmj.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx184565-AgsRIIkeNVmj.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx184565-AgsRIIkeNVmj.jpg","color":"#f1e4ae"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/184565/","mal":"https://myanimelist.net/manga/null/"};
export const m108919 = {"id":108919,"title":{"romaji":"Kaketa Tsuki to Doughnuts","english":"Doughnuts Under a Crescent Moon"},"description":"Uno Hinako throws herself into makeup, fashion, and falling in love, hoping that will make her seem “normal” to the other people at her job. But no matter how hard she tries, she’s a self-doubting mess inside, and her attempts at “normal” romance with men just keep failing. When she starts to think she might be alone forever, a new normal presents itself–in the form of her relationship with Sato Asahi, a level-headed woman who works at her company, which starts as respect until it becomes far more intimate.<br>\n<br>\n(Source: Seven Seas Entertainment)","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx108919-NSKHxpPmsC9k.png","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx108919-NSKHxpPmsC9k.png","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx108919-NSKHxpPmsC9k.png","color":null},"chapters":20,"volumes":4,"anilist":"https://anilist.co/manga/108919/","mal":"https://myanimelist.net/manga/120329/"};
