export const m98533 = {"id":98533,"title":{"romaji":"Now Loading...!","english":"Now Loading...!"},"description":"Takagi Suzu has a lot of ups (and downs) working in the video game industry, but she’s about to level up: Sakurazuki Kaori, a powerful director in the company who made Takagi’s favorite game, has come to guide Takagi on her next mission. Sakurazuki can be a bit harsh, but she’s also an experienced leader who will help Takagi gain advanced skills–and the two women might just unlock a new romance along the way!<br>\n<br>\n(Source: Seven Seas Entertainment)","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/nx98533-ei3nBQmYGLaT.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/nx98533-ei3nBQmYGLaT.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/nx98533-ei3nBQmYGLaT.jpg","color":"#fff143"},"chapters":5,"volumes":1,"anilist":"https://anilist.co/manga/98533/","mal":"https://myanimelist.net/manga/105658/"};
export const m136253 = {"id":136253,"title":{"romaji":"Maitsuki Niwa-tsuki Ouya-tsuki","english":"Monthly in the Garden with My Landlord"},"description":"Manga editor Asako Suga decides moving into a new home is just the thing she needs to get over a painful breakup with her toxic ex-girlfriend. She finds the perfect place for rent—affordable, spacious, lovely garden included—but there’s one catch. The house comes with a live-in landlord! It’s disappointing enough that Asako can’t have the single life she hoped for, but her cute landlord also seems to be hiding a big secret...Will living together bring them closer, or turn out to be more trouble than it’s worth?\n<BR><BR>\n(Source: Yen Press)\n<BR><BR>\nNote: Inclues 5 extra chapters","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx136253-yF4tYUktaawC.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx136253-yF4tYUktaawC.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx136253-yF4tYUktaawC.jpg","color":"#d6ae78"},"chapters":36,"volumes":5,"anilist":"https://anilist.co/manga/136253/","mal":"https://myanimelist.net/manga/139138/"};
export const m149755 = {"id":149755,"title":{"romaji":"Kyou wa Mada Futsuu ni Narenai","english":null},"description":"Takahashi, a 27-year-old freelancer who likes cute girls, and Yamashita, a fast-paced but sensitive manga artist. At the end of their high school years, the two, who had no desire to find a job or go on to higher education, have been together ever since they got detention for their desired career path. Going on to higher education, getting a job, getting married...they are troubled by the \"futsuu\" they often encounter in their lives, but somehow manage to stay positive. Two girls. A just-right relationship that loosely fits their hearts.\n<br><br>\n(Source: Ichijinsha, translated)\n\n","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx149755-EyqOSAJUYuOP.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx149755-EyqOSAJUYuOP.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx149755-EyqOSAJUYuOP.jpg","color":"#e4c91a"},"chapters":18,"volumes":1,"anilist":"https://anilist.co/manga/149755/","mal":"https://myanimelist.net/manga/148652/"};
export const m110194 = {"id":110194,"title":{"romaji":"Okubyou na Takase-san wa Kyou mo Kanojo wo Machi Wabiru","english":"A Timid Woman Longing For Her Delivery Girl"},"description":"Every Thursday, Kei receives packages to support her shut-in lifestyle. At her previous job, she was the victim of sexual harassment and has since found it difficult to be around other people, leading her to work freelance. Then she meets Rinko, the new delivery girl with a positive and cheerful personality. As their relationship begins to grow, so does Kei's curiosity for her.<br><br>(Source: Renta!)","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx110194-jncho7Wpo1pt.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx110194-jncho7Wpo1pt.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx110194-jncho7Wpo1pt.jpg","color":"#f1785d"},"chapters":3,"volumes":null,"anilist":"https://anilist.co/manga/110194/","mal":"https://myanimelist.net/manga/null/"};
export const m139014 = {"id":139014,"title":{"romaji":"Watashi no Onaka no Sekinin Totte!","english":null},"description":"A girl that loves food, and the girl that enjoys feeding her manage the battle of overeating vs delicious food in this romantic comedy!\n<BR><BR>\n<I>Note: Includes two volume bonus chapters.</i>","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx139014-6bOkM1VUlSlZ.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx139014-6bOkM1VUlSlZ.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx139014-6bOkM1VUlSlZ.jpg","color":"#f1c950"},"chapters":14,"volumes":2,"anilist":"https://anilist.co/manga/139014/","mal":"https://myanimelist.net/manga/143651/"};
export const m134668 = {"id":134668,"title":{"romaji":"Tabimiman","english":null},"description":"Harukawa, an an office worker, loves going on outings. Akiyama, a novelist, just wants to laze about in the house all day. This is the life of two women who live together in Shiga Prefecture, going on laid-back outings that are more relaxed than a trip, but more exciting than a stroll!\n<br><br>\n(Source: Kadokawa, translated)\n<br><br>\n<i>Note: Includes 2 extra chapters.</i>","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx134668-4xSUkHnlSgtX.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx134668-4xSUkHnlSgtX.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx134668-4xSUkHnlSgtX.jpg","color":"#f1e450"},"chapters":19,"volumes":2,"anilist":"https://anilist.co/manga/134668/","mal":"https://myanimelist.net/manga/155525/"};
export const m166692 = {"id":166692,"title":{"romaji":"3-bun Matte Mugi-senpai","english":null},"description":"Add hot water and wait three minutes.<BR>\nEating instant noodles with Mugi-senpai is the most delicious experience in this world!<BR>\n<BR>\nShio Yuasa is a university student who is busy with her research project day and night, and the graduate student Tsumugi Yakushiji is her supervisor.\nEvery day at university, they work hard to push their research forward until late at night, when they reward themselves with a cup of instant noodles in the lab.\nThis is a story of the science students' adolescence, research, love, and instant noodles.\n<BR><BR>\nCup-o-Noodle, Maruchan's Akai Kitsune and Green Tanuki, Peyoung... All sorts of instant noodles appear under their real names!\nThe brands appearing in this work are used with the permission of the rights holders.\n<BR><BR>\n(Source: Ura Sunday, translated)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx166692-xHtz6qBTsKQE.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx166692-xHtz6qBTsKQE.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx166692-xHtz6qBTsKQE.jpg","color":"#f1436b"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/166692/","mal":"https://myanimelist.net/manga/160265/"};
export const m110530 = {"id":110530,"title":{"romaji":"Ichido dake demo, Koukai Shitemasu.","english":"I Can't Believe I Slept With You!"},"description":"Twenty-four-year-old Koduka Chiyo quit her job and is wallowing in self-pity in her apartment. She’s also three months behind on her rent. Then her landlady proposes an unusual solution: have sex with her, and she’ll help with the debt, the filthy apartment, and the loneliness driving Chiyo to beer and escapism. After a one-night stand, the two women decide to keep up the arrangement. Their growing relationship leads to questions of identity, getting one’s life together, and if something tender can develop from an arrangement that started with a bang.\n<br><br>\n(Source: Seven Seas Entertainment)\n<br><br>\n<i>Notes:<br>\n- Chapter count includes 1 extra.<br>\n- Nominated for the Tsugimanga 2020 Award in the Manga Category.<i>","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx110530-PHUI83QuJzXv.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx110530-PHUI83QuJzXv.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx110530-PHUI83QuJzXv.jpg","color":"#f19300"},"chapters":20,"volumes":3,"anilist":"https://anilist.co/manga/110530/","mal":"https://myanimelist.net/manga/120716/"};
export const m112621 = {"id":112621,"title":{"romaji":"Lonely Girl ni Sakaraenai","english":"I Can't Say No to the Lonely Girl"},"description":"In this juicy yuri manga, the goody-goody high school girl Sakurai meets a lonely girl—and ends up entangled in a web of blackmail that might just lead to romance. It's hard to keep up with school when you can never say no to a devious classmate!\n<BR><BR>\n(Source: Kodansha USA)\n<BR><BR>\n<i>Note: Chapter count includes one side chapter and four volume-bonus chapters.</i>","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx112621-0ws0GgQ7Z2i7.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx112621-0ws0GgQ7Z2i7.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx112621-0ws0GgQ7Z2i7.jpg","color":null},"chapters":37,"volumes":6,"anilist":"https://anilist.co/manga/112621/","mal":"https://myanimelist.net/manga/123270/"};
export const m103845 = {"id":103845,"title":{"romaji":"Dekisokonai no Himegimi-tachi","english":"Failed Princesses"},"description":"Opposites attract in this new high school yuri manga!\n<br><br>\nFujishiro Nanaki is super cute, super popular, and super annoyed with anyone as plain as her classmate Kurokawa Kanade. When Nanaki finds out her boyfriend’s cheating on her, however, her life makes a complete 180—as does her relationship with Kanade. This all-new yuri manga series explores the budding romance between the cool girl in school and the “plain” girl she once brushed off!\n<br><br>\n(Source: Seven Seas Entertainment)\n","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/nx103845-VN4d2ElcvNmO.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/nx103845-VN4d2ElcvNmO.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/nx103845-VN4d2ElcvNmO.jpg","color":null},"chapters":41,"volumes":6,"anilist":"https://anilist.co/manga/103845/","mal":"https://myanimelist.net/manga/114788/"};
export const m108069 = {"id":108069,"title":{"romaji":"Hino-san no Baka","english":null},"description":"Class president and overall good girl Koguma is concerned that her classmate Hino often skips classes by spending her time behind one of the school buildings. Koguma feels it's her duty to guide Hino down a better path, even if it means going along with Hino's unusual requests.\n","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx108069-0o09tvykf8Pu.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx108069-0o09tvykf8Pu.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx108069-0o09tvykf8Pu.jpg","color":"#e4935d"},"chapters":135,"volumes":null,"anilist":"https://anilist.co/manga/108069/","mal":"https://myanimelist.net/manga/113912/"};
export const m106067 = {"id":106067,"title":{"romaji":"Watashi ni Karada, Utte Minai?","english":"Want to Sell Me Your Body?"},"description":"\"That makes a grand total of 100 thousand dollars.\" After Tsukasa's mom is killed in a car accident, her dad becomes addicted to drinking and gambling. One day, he disappears, leaving Tsukasa with a debt of 30 thousand dollars. There's no way a student like Tsukasa could get her hands on that much money! Eventually, debt collector Reiko shows up, inviting herself into Tsukasa's home and telling her to pay up. She offers the young girl a way of getting cash fast: by selling herself to Reiko. \"Want to sell me your body?\" Tsukasa agrees without really understanding what that entails, and when Reiko moves in with her, their relationship suddenly takes an unexpected turn... <br><br>(Source: Renta!)","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx106067-YMrpZY33MwwY.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx106067-YMrpZY33MwwY.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx106067-YMrpZY33MwwY.jpg","color":null},"chapters":6,"volumes":1,"anilist":"https://anilist.co/manga/106067/","mal":"https://myanimelist.net/manga/114156/"};
export const m177399 = {"id":177399,"title":{"romaji":"Shuuniichido Classmate wo Kau Hanashi: Futari no Jikan, Iiwake no Gosen Yen","english":null},"description":"Once a week, Miyagi pays 5,000 yen to her classmate Sendai to buy three hours of Sendai’s time, which allows Miyagi to give her orders. Miyagi is at the bottom of the school caste while Sendai is at the top. The two, who have nothing to do with each other at school, spend time together after school under this contract. Miyagi’s orders are determined by her mood that day, and Sendai cannot disobey. One day after school… Miyagi calls Sendai to her room and gives her an unusual order.","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx177399-9xPlWixpDuAT.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx177399-9xPlWixpDuAT.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx177399-9xPlWixpDuAT.jpg","color":"#35bbe4"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/177399/","mal":"https://myanimelist.net/manga/156052/"};
export const m180856 = {"id":180856,"title":{"romaji":"Yuri no Hajimari wa Dorei Kara","english":null},"description":"Chiyoko Hanamura is a girl who has failed in her attempt to remake herself into a “gal” for her high school debut.\nWhile skipping class on the rooftop as usual, a kouhai girl, Sakine, comes to ask her for a favor, showing her an anonymous love letter.\n<BR><BR>\nSakine asks her, “Can you go turn down this confession for me?” \n<BR><BR>\nFor the sake of her cute kouhai and to maintain her dignity as a gal, Chiyoko accepts the request and sets out to decline the confession, not knowing who would be there…\n<BR><BR>\n(Source: ComicWalker, translated)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx180856-dCwImbJ5eMYp.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx180856-dCwImbJ5eMYp.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx180856-dCwImbJ5eMYp.jpg","color":"#d6f15d"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/180856/","mal":"https://myanimelist.net/manga/174000/"};
export const m183605 = {"id":183605,"title":{"romaji":"Kao Dake Yoi Kurasumeito ga, Yatara to Guigui kuru Hyaku Yuri no Hanashi. ","english":null},"description":"Ritsu Kaido has a boyfriend, whom she is dating just because they're both members of the popular crowd.\nOn a summer day, she and her boyfriend were about to celebrate their one-year anniversary, her classmate Tsuzuri Yarai sees them about to kiss and intervenes......?\n<BR><BR>\nThe story is about an ordinary high school girl who falls in love with another girl who is energetic, kind, outgoing, and beautiful, too.\n<BR><BR>\n(Source: ComicWalker, translated)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx183605-KqPM2ciFuJwm.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx183605-KqPM2ciFuJwm.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx183605-KqPM2ciFuJwm.jpg","color":"#d6e443"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/183605/","mal":"https://myanimelist.net/manga/null/"};
export const m120067 = {"id":120067,"title":{"romaji":"Futari Escape","english":"Futari Escape"},"description":"Two young women–one an overworked manga artist, the other a complete slacker–try to escape the realities of adult responsibilities. Whether it’s running off on a day trip instead of being productive or going into debt for an epic meal, the two always have fun when they’re together! Enjoy this delightful (and relatable) slice-of-life tale about the little pleasures in ducking away from the hard stuff.<br> \n<br> \n(Source: Seven Seas Entertainment)<br>\n<br>\n<i>Notes:<br>\n- Originally released as a doujinshi at COMITIA 130 and 131. Began serialization in Comic Yuri Hime on July 18, 2020.<br>\n- Includes 4 extra chapters.</i>","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx120067-umoeeuttLaRM.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx120067-umoeeuttLaRM.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx120067-umoeeuttLaRM.jpg","color":"#f1f10d"},"chapters":36,"volumes":4,"anilist":"https://anilist.co/manga/120067/","mal":"https://myanimelist.net/manga/130414/"};
export const m100187 = {"id":100187,"title":{"romaji":"Nettaigyo wa Yuki ni Kogareru","english":"A Tropical Fish Yearns for Snow"},"description":"Konatsu is doing her best to adapt to her new school, but being required to join a club has introduced additional pressures. Her friendly classmate Kaede invites her to join the Home Ec Club, but Konatsu hasn’t even had time to consider which club she’s interested in. Meanwhile, Koyuki is like a ray of sunshine in Konatsu’s cloudy world. Will Konatsu join the Aquarium Club?\n<br><br>\n(Source: Viz Media)","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/nx100187-RSku0wTdV2QM.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/nx100187-RSku0wTdV2QM.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/nx100187-RSku0wTdV2QM.jpg","color":"#50bbe4"},"chapters":34,"volumes":9,"anilist":"https://anilist.co/manga/100187/","mal":"https://myanimelist.net/manga/109909/"};
export const m53239 = {"id":53239,"title":{"romaji":"Himawari-san","english":null},"description":"Himawari-san is the owner of an old bookstore, and a highschool girl comes in and asks for a job. Their friendship starts from there. \n<BR><BR>\n<I>Note: Includes two omake chapters and a seven-chapter extra story.</i>","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx53239-Al6W4K73jyYw.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx53239-Al6W4K73jyYw.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx53239-Al6W4K73jyYw.jpg","color":"#e4506b"},"chapters":109,"volumes":13,"anilist":"https://anilist.co/manga/53239/","mal":"https://myanimelist.net/manga/23239/"};
export const m143147 = {"id":143147,"title":{"romaji":"Kuchibeta Shokudou","english":null},"description":"For five years, she's been eating at the set-meal restaurant but didn't feel comfortable saying anything more, and the waitress at the restaurant who wanted to talk to that regular customer but couldn't get the words out. Their feelings are leaking out, but they just couldn't express their love for each other in many ways.\n<br><br>\n(Source: ComicWalker, translated)\n<br><br>\n<i>Note: Originally self-published on Twitter, it was picked up for commercial publication on December 10, 2021.</i>\n","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx143147-GlDf4i3hxmD3.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx143147-GlDf4i3hxmD3.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx143147-GlDf4i3hxmD3.jpg","color":"#e4935d"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/143147/","mal":"https://myanimelist.net/manga/144453/"};
export const m138110 = {"id":138110,"title":{"romaji":"Sake to Oni wa Ni-gou made","english":null},"description":"Naori Shida is a college student who loves making alcoholic drinks but has no friends to share them with. At a mixer, she meets Hinata Ibuki, who she ends up taking home with her. After making her a drink, Naori discovers that Hinata is an ogre-girl descended from Shuten-doji who needs alcohol to live, can only drink alcohol offered to her by humans, and grows horns whenever she drinks. Thus, Hinata decides to make Naori her personal bartender.","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx138110-KBjso1rsdzXh.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx138110-KBjso1rsdzXh.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx138110-KBjso1rsdzXh.jpg","color":"#e4aea1"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/138110/","mal":"https://myanimelist.net/manga/142108/"};
export const m163156 = {"id":163156,"title":{"romaji":"Pension Life Vampire","english":"The Pension Life Vampire"},"description":"Vampires and werewolves... One day, Eri, a \"revision officer\" who hunts down things that are said to resent mankind, wanders into a pension run by a mysterious girl. The encounter between a girl whose existence was denied and a legendary vampire. She won't change the world, but she can become kind. A heartwarming house administration comedy begins now!\n<br><br>\n(Source: MANGA Plus)","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx163156-RLH5kMqhM8oL.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx163156-RLH5kMqhM8oL.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx163156-RLH5kMqhM8oL.jpg","color":"#e4ae43"},"chapters":24,"volumes":4,"anilist":"https://anilist.co/manga/163156/","mal":"https://myanimelist.net/manga/157437/"};
