export const m164704 = {"id":164704,"title":{"romaji":"Okashi na Elf to Joshikousei","english":null},"description":"Japanese sweets save a debt-ridden elf!\n<br><br>\nAlice, an elf, runs a confectionery shop in the forest of Auin to pay off the debt left by her parents.<br>\nOne day, however, when she is worried that her sweets are not selling, she suddenly falls into the \"Fountain of Wishes.<br>\nWhen she opens her eyes, she finds herself in a strange world...\n<br><br>\n<i>Note: Chapter count includes 2 extra chapters.</i>","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx164704-SqmvRdISkLRZ.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx164704-SqmvRdISkLRZ.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx164704-SqmvRdISkLRZ.jpg","color":"#e4a143"},"chapters":18,"volumes":3,"anilist":"https://anilist.co/manga/164704/","mal":"https://myanimelist.net/manga/161117/"};
export const m109895 = {"id":109895,"title":{"romaji":"Maya-san no Yofukashi","english":null},"description":"Maya is a witch. At least, that's what she's always telling her friend Mameyama. To Mameyama, she's just an otaku girl that might have a few screws loose. Either way, the two of them spend late nights together on voice chat, talking about whatever random, trifling things come to mind.\n","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx109895-395AddJmHcax.png","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx109895-395AddJmHcax.png","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx109895-395AddJmHcax.png","color":"#e4c90d"},"chapters":39,"volumes":3,"anilist":"https://anilist.co/manga/109895/","mal":"https://myanimelist.net/manga/111062/"};
export const m116981 = {"id":116981,"title":{"romaji":"Food Court de, Mata Ashita.","english":"See You Tomorrow at the Food Court"},"description":"To their classmates, Wada is a quiet rich girl while Yamamoto is an intimidating lone wolf…but what they don’t know is that Wada is a mobile game addict in a passionate love-hate relationship (with a 2D character) and Yamamoto has a penchant for urban legends with eyes only for her favorite YouTuber. And their biggest not-so-secret secret—these unlikely friends meet at the food court every day after school to rant, rave, and learn what makes each other tick!\n<br><BR>\n(Source: Yen Press)<br>\n<br>\n<i>Note: Originally published as a Twitter webcomic. It received a 15-chapter serialization in Comic Newtype between 2020-03-10 to 2021-01-12. Additional serialization resumed on 2022-09-06.</i>","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx116981-jnWUzccvQtLY.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx116981-jnWUzccvQtLY.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx116981-jnWUzccvQtLY.jpg","color":"#c98650"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/116981/","mal":"https://myanimelist.net/manga/123519/"};
export const m149760 = {"id":149760,"title":{"romaji":"Bunnie's Quest","english":null},"description":"On the moon, there is an advance civilization of bunny people who used to be identical to humans, but after incorporating themselves with bunny genes, transformed into docile creatures. The result is a society where AI are entrusted with all choices, from the content of meals to how each minute of leisure time should be spent. Amongst this society is a bunny girl named Uko who dislikes this lifestyle, complaining \"Let me choose for myself!!\". One day, Uko decides to flee the moon and head to Earth where she meets Hane, a bunny girl investigating life on Earth. On this planet with many strange customs, these two will...!?\n<br><br>\n(Source: Kodansha, translated)\n<br><br>\n<i>Note: Includes 1 extra chapter.</i>","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx149760-LKk1dqcU372j.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx149760-LKk1dqcU372j.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx149760-LKk1dqcU372j.jpg","color":"#50c9f1"},"chapters":16,"volumes":2,"anilist":"https://anilist.co/manga/149760/","mal":"https://myanimelist.net/manga/153939/"};
export const m109651 = {"id":109651,"title":{"romaji":"Kanojo no Idea","english":null},"description":"Ever since middle school, Hinata has been a huge fan Sumika Nayuki, an actress of her same age. Now in high school, Hinata ran into Sumika on the street, and was shocked to find her idol's real-life behavior to be very different from the public persona that Hinata worshiped.\n<br><br>\n(Source: Kadokawa, translated)\n<br><br>\n<i>Note: Chapter count includes 16 regular chapters and 3 extras.</i>","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx109651-EpYghqJJImpy.png","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx109651-EpYghqJJImpy.png","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx109651-EpYghqJJImpy.png","color":"#e43550"},"chapters":19,"volumes":3,"anilist":"https://anilist.co/manga/109651/","mal":"https://myanimelist.net/manga/122869/"};
export const m133500 = {"id":133500,"title":{"romaji":"Oshi ga Imouto ni Narimashite","english":null},"description":"Kazuka Kojima is a pretty and popular high school girl secretly obsessed with the idol \"Kane-chan\". When her parent remarried, she found out her new step-sister Akane is the \"everyone's sister\" - the \"Kane-chan\" of her dreams!　Hyper yuri love comedy begins!\n<br><br>\n(Source: Comic Boost, translated)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx133500-p92VAMFI14BR.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx133500-p92VAMFI14BR.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx133500-p92VAMFI14BR.jpg","color":"#e4505d"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/133500/","mal":"https://myanimelist.net/manga/145661/"};
export const m140060 = {"id":140060,"title":{"romaji":"Daisuki na Shinyuu ga VTuber no Jibun ni Gachi Koishiteta Hanashi","english":null},"description":"Manga artist Oshiga Sukoya is in love with the Vtuber Doujima Taiga and constantly gushes about her to her best friend Hariyama Teruko. Little does Sukoya know that Teruko is A.) the person behind Doujima Taiga, and B.) secretly in love with Sukoya.\n<BR><BR>\n<I>Note: Originally self-published on Pixiv, it was collected for publication by Futabasha on 2023-09-21.</i>\n","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx140060-choyLzknXf2Z.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx140060-choyLzknXf2Z.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx140060-choyLzknXf2Z.jpg","color":"#e45d78"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/140060/","mal":"https://myanimelist.net/manga/163035/"};
export const m117639 = {"id":117639,"title":{"romaji":"Seiyuu Radio no Uraomote ","english":"The Many Sides of Voice Actor Radio"},"description":"Yumiko Sato works as a voice actress with a stage name \"Yasumi\". She hides that she is a \"Gyaru\", plays an innocent character in front of the audience.\nShe respects Yuhi Yugure, who is also a voice actress and a highschooler. Yuhi's popularity is on the rise, and she had even done a concert in front of her fans.\nYumiko is anxious... it's her second year as a voice actress, and she has to be famous in a year or else she will have to quit this job.\nOne day, she is offered to be a cohost to a weekly radio program with Yuhi Yugure. The director of the program is totally excited... just because he knew that they were classmates!<br>\n<BR>\nYumiko couldn't be more surprised--to know that Yuhi Yugure was Chika Watanabe, a grim-looking girl in her class!\n<br><br>\n<i>Note: Originally concluded with 3 volumes and 17 chapters on 2021-07-27, additional serialization started 2023-12-26, in support of the anime.</i>","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx117639-LNPUp1xeThEg.png","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx117639-LNPUp1xeThEg.png","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx117639-LNPUp1xeThEg.png","color":"#f1ae28"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/117639/","mal":"https://myanimelist.net/manga/130236/"};
export const m107987 = {"id":107987,"title":{"romaji":"Sasayaku You ni Koi wo Utau","english":"Whisper Me a Love Song"},"description":"Bubbly, energetic first-year high school student Himari falls head over heels for her senpai Yori after hearing her band perform on the first day of school. Himari tells Yori she just loves her, and to Himari's surprise, Yori says she loves Himari back! But when Himari realizes that she and her senpai are feeling two different kinds of love, she begins to ask herself what \"love\" really means...\n<br><br>\n(Source: Kodansha USA)\n<br><br>\n<i>Notes:<br>\n- Eighteenth place of Tsugimanga 2020 Award in the Manga Category<br>\n- First place in Yuri Navi’s best Yuri Manga of 2020</i>","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx107987-ElkhUHShDp2a.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx107987-ElkhUHShDp2a.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx107987-ElkhUHShDp2a.jpg","color":"#f143a1"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/107987/","mal":"https://myanimelist.net/manga/118625/"};
