export const m161653 = {"id":161653,"title":{"romaji":"Kimi no Tame no Curtain Call","english":"A Curtain Call for You"},"description":"Shy, mousy Sakura Akutsu is content to keep her adventures confined to the pages of her notebook—until the brash, outgoing new transfer student Tsubame Hiiragi gets her hands on it, that is. The two secretly share the stories Sakura spins, but soon that secret proves too big to keep, and Tsubame whisks Sakura into a glittering world she could never have imagined!<br>\n<br>\nAs Sakura learns to be confident in who she is and ignore what others think, Tsubame learns to go below the surface and dig deep for emotional truths that may have eluded her... Together they'll learn about art, love, truth, and most of all, the theater...!<br>\n<br>\n(Source: Kodansha USA)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx161653-P2mlymCyD1tz.png","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx161653-P2mlymCyD1tz.png","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx161653-P2mlymCyD1tz.png","color":"#e42850"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/161653/","mal":"https://myanimelist.net/manga/171148/"};
