export const m130799 = {"id":130799,"title":{"romaji":"Finder Goshi no Ano Ko","english":null},"description":"Hajime, a girl who can’t seem to properly express her feelings into words, is worrying all on her own about the preparations for the cultural festival. This will be the last festival for her film club. There’s always been things she’s wanted to do for the festival, but like last year, she’s given up and the festival will probably end without her doing what she wants to do.<br>\nThat’s when she meets Kei Ichinose, another student at her schoolー\n<br><br>\n(Source: Dogenzaka Shobo, translated)\n<br><br>\n<i>Note: Chapter count includes two extra chapters.<i>","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx130799-4K3Pfp8Mu2Ui.png","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx130799-4K3Pfp8Mu2Ui.png","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx130799-4K3Pfp8Mu2Ui.png","color":null},"chapters":9,"volumes":2,"anilist":"https://anilist.co/manga/130799/","mal":"https://myanimelist.net/manga/134834/"};
export const m102813 = {"id":102813,"title":{"romaji":"Watashi-tachi wa Koi wo Egakenai","english":null},"description":"Onodera Kano and Nanase Miyuu have recently made their debut as a manga author duo with Kano writing the story and Miyuu drawing the art. However, Miyuu needs some help drawing love scenes, so she gets Kano to agree to act as her \"boyfriend\" to keep their manga aspirations alive. The only problem is that Kano has mixed feelings about it because she secretly harbors feelings for Miyuu.\n","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/nx102813-oDuMyhnjl392.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/nx102813-oDuMyhnjl392.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/nx102813-oDuMyhnjl392.jpg","color":"#43aee4"},"chapters":21,"volumes":2,"anilist":"https://anilist.co/manga/102813/","mal":"https://myanimelist.net/manga/115596/"};
export const m106785 = {"id":106785,"title":{"romaji":"Kami Eshi JK to OL Fujoshi","english":"Drawn Together"},"description":"With BL manga as her greatest and only love, Aizawa is destined to be forever alone. All her time not spent in the office is spent fawning over fanart of her favorite pairing, completely wasting her beauty. One day, the goddess of her world, the artist Misumi, announces that she will descend on a comic convention, so off Aizawa goes! When she finds Misumi's booth, what awaits her is...a super cute high school girl?!\n<br><br>\n(Source: INKR)","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx106785-BgulCPCor3Wg.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx106785-BgulCPCor3Wg.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx106785-BgulCPCor3Wg.jpg","color":"#e44393"},"chapters":27,"volumes":5,"anilist":"https://anilist.co/manga/106785/","mal":"https://myanimelist.net/manga/121932/"};
export const m106232 = {"id":106232,"title":{"romaji":"Still Sick","english":"Still Sick"},"description":"Makoto Shimizu is just an ordinary office worker, blending in seamlessly with her colleagues on the job... That is, until her coworker Akane Maekawa discovers her well-hidden secret: in her spare time, she draws and sells girls' love comics!\n<br><br>\nAkane is the last person Makoto would think of as a nerd, but as the two grow closer, it starts to seem like Akane may have a secret of her own...  \n<br><br>\n(Source: TOKYOPOP)\n<br><br>\n<i>Note: Includes 3 bonus chapters.</i>","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/nx106232-LfXVW5dROdap.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/nx106232-LfXVW5dROdap.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/nx106232-LfXVW5dROdap.jpg","color":"#e4865d"},"chapters":26,"volumes":3,"anilist":"https://anilist.co/manga/106232/","mal":"https://myanimelist.net/manga/116472/"};
export const m122344 = {"id":122344,"title":{"romaji":"Tensei Oujo to Tensai Reijou no Mahou Kakumei","english":"The Magical Revolution of the Reincarnated Princess and the Genius Young Lady"},"description":"Princess Anisphia may not be able to use magic, but she didn’t let that stop her from developing “magicology,” a unique theory based on memories from her past life. While testing out her new flying broom, she happens across Euphyllia, a magical genius, having her engagement unjustly and publicly broken off. Seeing the tears in Euphyllia’s eyes, Anisphia takes the obvious course of action—kidnapping the girl for herself!\n<BR><BR>\n(Source: Yen Press)\n","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx122344-NUecmoX09FTw.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx122344-NUecmoX09FTw.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx122344-NUecmoX09FTw.jpg","color":"#e48628"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/122344/","mal":"https://myanimelist.net/manga/130893/"};
export const m118695 = {"id":118695,"title":{"romaji":"Watashi no Oshi wa Akuyaku Reijou.","english":"I’m in Love with the Villainess"},"description":"The story of a reincarnated gamer pursuing her villainous lady love at a fantasy girls’ academy!\n<br><br>\nOrdinary office worker Oohashi Rei has just woken up in the body of the protagonist of her favorite girls’ otome game, Revolution. To her delight, the first person to greet her is her favorite character, Claire Francois–who just so happens to be the main antagonist of the story. Now, Rei is determined to do what the game never allowed: romance Claire instead of one of the male leads. But how will her villainous lady love react to that?!\n<br><br>\n(Source: Seven Seas Entertainment)\n\n","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx118695-1tu59SDGxXl6.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx118695-1tu59SDGxXl6.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx118695-1tu59SDGxXl6.jpg","color":"#e44343"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/118695/","mal":"https://myanimelist.net/manga/129361/"};
export const m103608 = {"id":103608,"title":{"romaji":"Bocchi Kaibutsu to Moumoku Shoujo","english":null},"description":"When a monster girl stumbles upon a blind girl who doesn't run away from her, the two begin to bond. The blind girl listens to the monster as if she were human, and the monster slowly begins to feel warmth in her heart.\n","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx103608-CaOYFnWesDkD.png","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx103608-CaOYFnWesDkD.png","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx103608-CaOYFnWesDkD.png","color":"#f1ae5d"},"chapters":50,"volumes":null,"anilist":"https://anilist.co/manga/103608/","mal":"https://myanimelist.net/manga/null/"};
export const m108440 = {"id":108440,"title":{"romaji":"Vampeerz","english":"Vampeerz"},"description":"Ichika's life has taken a sudden turn. Her grandmother has passed away, so as family and friends come from far and wide to pay their respects, she finds herself in the spotlight as many of these old faces have taken an interest in her youth. As a fourteen-year-old Ichika could be dating. She could be participating in extra-curricular activities. She could be looking to her future. ...But she hasn't done any of that. All of that will change, when a young guest who she does not recognize visits her home. Aria seems to know quite a bit about her family and property, and while she may be there to say goodbye, she may have found her way into Ichika's heart.<br><br>(Source: Denpa)","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx108440-StfziwjQbhwJ.png","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx108440-StfziwjQbhwJ.png","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx108440-StfziwjQbhwJ.png","color":"#e47850"},"chapters":46,"volumes":9,"anilist":"https://anilist.co/manga/108440/","mal":"https://myanimelist.net/manga/121226/"};
export const m106997 = {"id":106997,"title":{"romaji":"\"Omae Gotoki ga Maou ni Kateru to Omou na\" to Yuusha Party wo Tsuihou Sareta node, Outo de Kimama ni Kurashitai","english":"ROLL OVER AND DIE: I Will Fight for an Ordinary Life with My Love and Cursed Sword!"},"description":"Flum Apricot was never meant to be a hero. Despite zero stats across the board and a power she can’t even use, she somehow finds herself included in a party of heroes. But Flum’s life hits rock bottom when the party’s renowned sage, Jean Inteige, decides that the useless girl is dead weight, and arranges to have her sold into slavery. Tossed to monsters to be feasted upon for her master’s entertainment, Flum makes the desperate choice to reach for a cursed weapon…and something new awakens within her. A grimdark tale about one woman’s blood-soaked quest to reclaim her life!\n<br><br>\n(Source: Seven Seas Entertainment)","format":"NOVEL","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/nx106997-hl3Az5371own.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/nx106997-hl3Az5371own.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/nx106997-hl3Az5371own.jpg","color":"#f17843"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/106997/","mal":"https://myanimelist.net/manga/115587/"};
export const m119857 = {"id":119857,"title":{"romaji":"Shokei Shoujo no Virgin Road","english":"The Executioner and Her Way of Life"},"description":"The Lost Ones are strangers from another world, hailing from a place no one has ever heard of called “Japan.” These wanderers have been associated with catastrophes since many years ago and the solemn duty of exterminating them without remorse falls to Menou, a young Executioner. But when her mission is complicated by a Japanese girl named Akari who refuses to die, Menou embarks on a peculiar journey to find something that can slay even an immortal who insists on traveling with her would-be-killer!\n<br><br>\n(Source: Yen Press)","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx119857-QV9S10pylOxn.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx119857-QV9S10pylOxn.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx119857-QV9S10pylOxn.jpg","color":"#e4bb5d"},"chapters":47,"volumes":7,"anilist":"https://anilist.co/manga/119857/","mal":"https://myanimelist.net/manga/131176/"};
export const m135169 = {"id":135169,"title":{"romaji":"Ao Hada Kyonyuu to Kuso Bocchi","english":null},"description":"Lian is an apprentice angel who attends a high school for angels built in Heaven. Despite continuously working hard to become an archangel, she is unable to make friends and quickly became hated amongst her class. To put it simply, she is a loner.\n<br><br>\nShe has a natural enemy: the school idol who looks like a gal demon, Ruri. Although she is not academically competent, Ruri is beloved by everyone. One day, however, Lian suddenly decides to start teaching Ruri! Ruri told her \"Let's start as friends,\" causing Lian to become confused as she previously hated her.\n<br><br>\nThis is the beginning of a friendship between a blue gal and a loner, a friendship that has until now been nonexistent, with the two enjoying every day of their youth!!!\n<br><br>\n(Source: Takeshobo, translated)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx135169-a4e5eAfWHxlr.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx135169-a4e5eAfWHxlr.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx135169-a4e5eAfWHxlr.jpg","color":"#e45d5d"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/135169/","mal":"https://myanimelist.net/manga/140145/"};
export const m114860 = {"id":114860,"title":{"romaji":"Kamitsuki Gakuen","english":null},"description":"The story is Shizuka’s awakening to life as a vampire, while she befriends classmates and fellow Epicureans, and tries to befriend Ichi-gou. Shizuka, on account of never feeding directly from a person is runty, and her bat wings are little, but with help she learns to find the idea of sucking Ichi-gou’s blood alluring.<br><br>(Source: Okazu)","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx114860-6eoD37BaDJPz.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx114860-6eoD37BaDJPz.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx114860-6eoD37BaDJPz.jpg","color":"#780d35"},"chapters":12,"volumes":2,"anilist":"https://anilist.co/manga/114860/","mal":"https://myanimelist.net/manga/104964/"};
export const m99544 = {"id":99544,"title":{"romaji":"Tensei Kyuuketsuki-san wa Ohirune ga Shitai","english":null},"description":"A polite and lethargic boy was reincarnated in another world as a vampire bishoujo. In this world of swords and magic, this protagonist who was reborn replete with all kinds of cheat powers was searching for one thing――! “Three meals a day, snacks and an afternoon nap, I guess.” Are you really the protagonist! And thus begins the fantasy comedy of a vampire looking for the ideal moocher lifestyle…?\n","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx99544-fwDFKUBm371f.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx99544-fwDFKUBm371f.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx99544-fwDFKUBm371f.jpg","color":"#f1f1c9"},"chapters":65,"volumes":13,"anilist":"https://anilist.co/manga/99544/","mal":"https://myanimelist.net/manga/107138/"};
export const m104988 = {"id":104988,"title":{"romaji":"SCARLET","english":"SCARLET"},"description":"After ingesting an illegal drug that makes her hunger for blood, Finé Hera makes a pact with a beautiful but wolfish Red Riding Hood. Iris Redhood offers herself up to help Finé slake her bloodlust, but her…services come with a price. Now, the two are narcotics officers on the hunt for the very drug that changed Finé!\n<br><br>\n(Source: Seven Seas Entertainment)","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx104988-BbQLRZV3apmt.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx104988-BbQLRZV3apmt.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx104988-BbQLRZV3apmt.jpg","color":"#e4ae5d"},"chapters":11,"volumes":2,"anilist":"https://anilist.co/manga/104988/","mal":"https://myanimelist.net/manga/115850/"};
export const m175145 = {"id":175145,"title":{"romaji":"Gakeppuchi Reijou wa Kurokishi-sama wo Horesasetai!","english":null},"description":"Her family is in debt, and they don't have enough money for her sick sister's treatment...\n<BR><BR>\nThe troubled noblewoman, Clarice, finds herself engaged in an arranged marriage with the black-knight Frost, the most fearsome warrior of the kingdom, known for \"slaughtering beasts with his bare hands\"!\nIn an attempt to secure her fortune, Clarice tries to seduce \"Sir Black Knight,\" and that was when she discovers \"her\" secret…\n<BR><BR>\n(Source: Yuri-Hime, translated)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx175145-1V7wu5a4nkkN.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx175145-1V7wu5a4nkkN.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx175145-1V7wu5a4nkkN.jpg","color":"#e4506b"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/175145/","mal":"https://myanimelist.net/manga/168293/"};
export const m148499 = {"id":148499,"title":{"romaji":"Onee-sama to Watashi: Ojou-sama ga isekai Tensei","english":"Sister and Giant: A Young Lady Is Reborn in Another World"},"description":"Reincarnated in another world, Hinako declines the abilities offered to her by the Goddess, and instead takes a vow of sisterhood with the giant Eiris, becoming known herself as “the smallest giant.” The two may be different species, born on different worlds, but they share one goal—searching for the precious siblings they lost. But they must be cautious, for just as their bond and strength win them fame, they also bring attention from the knights of the church…\n<br><br>\n(Source: Yen Press)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx148499-2r3EZPhEr3EY.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx148499-2r3EZPhEr3EY.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx148499-2r3EZPhEr3EY.jpg","color":"#f1d6c9"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/148499/","mal":"https://myanimelist.net/manga/146277/"};
