export const m105808 = {"id":105808,"title":{"romaji":"Hero-san to Moto Onna Kanbu-san","english":"Superwomen in Love! Honey Trap and Rapid Rabbit"},"description":"When the villainess Honey Trap defeats the superheroine Rapid Rabbit, she sees her nemesis’ face for the first time…and falls head over heels in love! Unable to kill Rapid Rabbit, Honey Trap is cast out of her evil organization, her plans for world domination dashed. Now, the two superwomen are teaming up to fight evil together. Can Honey Trap defeat her former colleagues and seduce the heroine at the same time?\n<br><br>\n(Source: Seven Seas Entertainment)","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx105808-pz5GMrhTA2Qj.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx105808-pz5GMrhTA2Qj.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx105808-pz5GMrhTA2Qj.jpg","color":"#e41a78"},"chapters":26,"volumes":5,"anilist":"https://anilist.co/manga/105808/","mal":"https://myanimelist.net/manga/117092/"};
export const m154008 = {"id":154008,"title":{"romaji":"Genkai OL-san wa Akuyaku Reijou-sama ni Tsukaetai","english":null},"description":"A heart-pounding re-employment(!?) story between a fed-up corporate slave and a cold, callous, villainess!\n<BR><BR>\nThree years after graduating college, Natori Midori, who once idealized the \"grown-up adults\" she saw as a child, was working hard at her temp job. However, one day, her contract was suddenly terminated for an absurd reason. As she sat there, wondering if there would ever be a workplace worth devoting herself to, her phone flashed and she found herself transmigrated into the world of the visual novel game she was playing. And before her eyes was the villainess, Lapis Tenebrae, who betrayed the heroine and committed countless atrocities before losing her life!\n<BR><BR>\n(Source: Dokodemo Young Champion, translated)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx154008-8ePItZG91GWX.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx154008-8ePItZG91GWX.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx154008-8ePItZG91GWX.jpg","color":"#5daef1"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/154008/","mal":"https://myanimelist.net/manga/150884/"};
export const m165204 = {"id":165204,"title":{"romaji":"Kiraware Majo Reijou to Dansou Ouji no Konyaku","english":null},"description":"Cursed by others as a \"witch\", Evris, the youngest daughter of the House of Bradley, is engaged to Mark, the fifth prince of the Kingdom of Klengel. When he abruptly announces that their engagement is broken off, Evris is plunged into despair. However, someone reaches out to her instead... The cross-dressing (female) crown prince of a neighboring country!?\n<BR><BR>\nThis is the story of a red-haired witch who manipulates shadows and a cross-dressing (female) crown prince who is serving as a body double for her missing older brother.\n<BR><BR>\nThe curtain rises on a fantasy romantic comedy of a girl being teased by a princess!\n<BR><BR>\n(Source: Yuri-Hime, translated)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx165204-f7RyP92t6Njm.png","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx165204-f7RyP92t6Njm.png","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx165204-f7RyP92t6Njm.png","color":"#f15086"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/165204/","mal":"https://myanimelist.net/manga/159193/"};
export const m167017 = {"id":167017,"title":{"romaji":"Twinstar Cyclone Runaway","english":null},"description":"Set 6,000 years after humanity has spread out across the stars, the story takes place inside a gigantic city ship orbiting a remote gas giant. The ship is home to a civilization of space fishers that catch valuable fish-like creatures known as Besshu. The society harvests the Besshu through ships operated by enforced male-female pairs of operator and pilot, who are seen by the male-dominated society as a married couple. The story centers on Terra, who is seeking a partner to operate a ship, and finds her in the mysterious runaway girl Diode, with both uniquely able to use the ship despite both being female.\n<BR><BR>\n(Source: Anime News Network)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx167017-gf2BpGdHV7Ou.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx167017-gf2BpGdHV7Ou.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx167017-gf2BpGdHV7Ou.jpg","color":"#ffc900"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/167017/","mal":"https://myanimelist.net/manga/160931/"};
export const m136921 = {"id":136921,"title":{"romaji":"Okiku-san wa Icha Tsukitai","english":null},"description":"Okiku, an evil spirit that terrorized many during the Edo era, has been reborn after 360 years. Modern exorcists are helpless against its power, so they tried to negotiate.<br>\n\"You can have anything you want, if you will spare the lives of the common people.\"<br>\n\"In that case, I will take that pretty girl over there!\"<br>\n<br>\nAn occult yuri comedy between a beautiful girl exorcist and a slightly naughty evil spirit!<br>\n<br>\n(Source: ComicWalker, translated)\n\n","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx136921-7cTdqxzvbQwJ.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx136921-7cTdqxzvbQwJ.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx136921-7cTdqxzvbQwJ.jpg","color":"#feae28"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/136921/","mal":"https://myanimelist.net/manga/145484/"};
export const m171729 = {"id":171729,"title":{"romaji":"LOVE-BULLET","english":null},"description":"Changing Cupid's love arrows into firearms. Koharu, the indecisive rookie Cupid, engages in romantic gun action with her unique senior colleagues!<br><br>\n(Source: Comic Walker, translated)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx171729-Jn6lCSZepPTs.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx171729-Jn6lCSZepPTs.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx171729-Jn6lCSZepPTs.jpg","color":"#e4351a"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/171729/","mal":"https://myanimelist.net/manga/166372/"};
export const m175451 = {"id":175451,"title":{"romaji":"Gal Maid to Akuyaku Reijou: Ojoo-sama no Happy End shika Katan!","english":null},"description":"The gal Selina is reincarnated in the world of an otome game that her otaku friends liked to play! Selina, reincarnated as an anonymous mob character, becomes a maid for the villainess Almeria.\n<BR><BR>\nIn this fantasy yuri romantic comedy, a maid with \"previous life: gal\" tries her best to make the villainess happy!\n<BR><BR>\n(Source: Yuri-Hime, translated)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx175451-qdkzrTtxKFMZ.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx175451-qdkzrTtxKFMZ.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx175451-qdkzrTtxKFMZ.jpg","color":"#f1bb50"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/175451/","mal":"https://myanimelist.net/manga/167800/"};
export const m178107 = {"id":178107,"title":{"romaji":"Muryoku Seijo to Munou Oujo: Maryoku Zero de Shoukan Sareta Seijo no Isekai Kyuukoku-ki","english":null},"description":"One day, listless part-timer Tamura Nana was summoned out of her room and into another world, after which her summoners declared her a saint and asked her to save their world. However, though she was hailed as a saint, it turned out that Nana possessed no magical power at all! To make matters worse, she was chosen as a partner by a princess who can't use magic...\n\nThe helpless saint who has no magic and the powerless princess who can't use magic. And so begins the adventure of these two leftover heroes!\n\n(Source: Yuri-Hime, translated)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx178107-Vhfv1eVUgtLa.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx178107-Vhfv1eVUgtLa.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx178107-Vhfv1eVUgtLa.jpg","color":"#f1c95d"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/178107/","mal":"https://myanimelist.net/manga/171206/"};
