export const m120112 = {"id":120112,"title":{"romaji":"Asumi-chan wa Rezu Fuuzoku ni Kyoumi ga Arimasu!","english":"Asumi-chan is Interested in Lesbian Brothels"},"description":"Sweet but awkward college student Asumi never got over her childhood crush on her old friend Mai. She’s mortified by the memory of their first kiss, which couldn’t have gone worse. When she discovers that Mai may be working at a nearby brothel, she sees her chance for redemption. There’s only one catch: none of the girls on the brothel’s website use their real names. Goaded along by a more experienced friend, Asumi begins a journey of exploring her sexuality, trying new fetishes, and getting comfortable in her own skin as she sleeps with the brothel’s women one at a time in her search for Mai. Is it possible Mai is searching for her out there, too? And when they finally reunite, will Asumi be experienced and confident this time?\n<br><br>(Source: Seven Seas Entertainment)","format":"MANGA","status":"RELEASING","isAdult":true,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx120112-fRg81ZZgLCxe.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx120112-fRg81ZZgLCxe.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx120112-fRg81ZZgLCxe.jpg","color":"#e45086"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/120112/","mal":"https://myanimelist.net/manga/130126/"};
