export const m141152 = {"id":141152,"title":{"romaji":"Kaguhara-san no Fetish Note","english":null},"description":"Kaguhara Ririka is a high school girl in her first year at Fu Eichi High School. She has an ordinary appearance, no personality to speak of, and no friends. However, she has a unique hobby that she keeps secret. She loves exploring all kinds of embarrassing \"fetishes\" of cute girls, and she keeps a diary of her observations of those girls trying to keep their fetishes to themselves! As Ririka seeks out the sweat, smell, and flesh of cute girls and record them writhing in shame, who will be the object of her observation tonight?\n<br><br>\n(Source: Gamma Plus, translated)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx141152-NZ550PGsvX7C.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx141152-NZ550PGsvX7C.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx141152-NZ550PGsvX7C.jpg","color":"#f15dae"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/141152/","mal":"https://myanimelist.net/manga/149000/"};
