export const m136508 = {"id":136508,"title":{"romaji":"Android wa Keiken Ninzuu ni Hairimasu ka?","english":"Does it Count if You Lose Your Virginity to an Android?"},"description":"Office Lady Tsuda Akane, age 28, seems like she’s got it all together. Beautiful, brainy, and an indispensable office worker for a robotics manufacturer, Akane’s admired at work…because her colleagues can’t see her at home. Privately, Akane’s a hot mess with an apartment that looks more like a landfill than a living space. Good thing she drunkenly ordered a new android named Nadeshiko to help her clean up! Well, maybe not good, because the beautiful lady android that arrives is a horny hottie. Akane’s about to get more service than she expected!\n<br><br>\n(Source: Seven Seas Entertainment)","format":"MANGA","status":"RELEASING","isAdult":true,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx136508-VPiHtLM3t6Zv.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx136508-VPiHtLM3t6Zv.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx136508-VPiHtLM3t6Zv.jpg","color":"#e450a1"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/136508/","mal":"https://myanimelist.net/manga/139899/"};
export const m170101 = {"id":170101,"title":{"romaji":"Kiyota-san wa Yogosaretai","english":null},"description":"Sumiko Kiyota is a plain, ordinary girl with a serious demeanor. While eating lunch alone as usual, Yuki Shirakawa, the most beautiful and popular girl in class, calls out to her...?\n<BR><BR>\n(Source: Tonari no Young Jump, translated)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx170101-xo1u2ZBzQoG6.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx170101-xo1u2ZBzQoG6.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx170101-xo1u2ZBzQoG6.jpg","color":"#f150ae"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/170101/","mal":"https://myanimelist.net/manga/167175/"};
export const m181042 = {"id":181042,"title":{"romaji":"Bokura no Ai wa Kimochi Warui","english":null},"description":"Everyone is hiding a \"secret.\"\n<br><br>\nAzuki Komugi is obsessed with ruminating on her memories of her high school girlfriend \"Meguru,\" and creating a body model of hers out of clay.\n<br><br>\nOne day, Azuki drops her homemade \"Meguru\" at the 100-yen shop where she works part-time, and sneaks into her workplace on her off-shift to get \"her\" back. However, what she sees there is a fellow co-worker, high school girl Yoyuki Remu, who is about to express her lust for \"Meguru\" in a way that is different from Azuki's...\n<br><br>\n(Source: Comic Yuri Hime, translated)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx181042-mkNs569fsbw5.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx181042-mkNs569fsbw5.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx181042-mkNs569fsbw5.jpg","color":"#e4436b"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/181042/","mal":"https://myanimelist.net/manga/172363/"};
export const m132041 = {"id":132041,"title":{"romaji":"Yuri Love Slave: Futari Dake no Houkago","english":null},"description":"Asakura is an ordinary high school girl. One day, she sees Reina, the cold and stuck-up class president, going into a bookstore. Asakura follows her in and discovers that the book Reina bought is a gay manga.\n<BR><BR>\nFeeling shocked and slightly ashamed, Asakura opens the book, and as she reads, she starts feeling funny inside. The little devil in her head whispers to her, \"Asakura-chan, do you want to try the things in this book? Do you feel turned on?\"\n<BR><BR>\nIgnoring the angel's warning on her right shoulder, Asakura's gives in to the devil's seduction, and her gay adventure with Reina begins...\n","format":"MANGA","status":"FINISHED","isAdult":true,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx132041-pc2G9KaSRzgO.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx132041-pc2G9KaSRzgO.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx132041-pc2G9KaSRzgO.jpg","color":"#f1a15d"},"chapters":18,"volumes":3,"anilist":"https://anilist.co/manga/132041/","mal":"https://myanimelist.net/manga/147305/"};
