export const m97708 = {"id":97708,"title":{"romaji":"Ani no Yome to Kurashiteimasu.","english":"Living With My Brother's Wife"},"description":"Kishibe Shino, a high school student. 17 years old. Her parents died, and then six months ago, so did her older brother, her only remaining blood relative. Now she lives with her “brother’s wife,” Nozomi-san. “We might not be blood related, but we’re family.” The story they write is a bit clumsy but full of something inexplicable. Slowly but surely, they happily grow together through their sensitive daily life.<br><br>\n(Source: MANGA UP!)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx97708-pTwn9WEQ7NDy.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx97708-pTwn9WEQ7NDy.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx97708-pTwn9WEQ7NDy.jpg","color":null},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/97708/","mal":"https://myanimelist.net/manga/94342/"};
export const m123777 = {"id":123777,"title":{"romaji":"Watashi wo Tabetai, Hitodenashi","english":"This Monster Wants to Eat Me"},"description":"<i>“I’ve come to eat you.”</i> <br> So softly utters the mermaid Shiori as she emerges from the sea and takes high school girl Hinako by the hand. Hinako lives alone in a town by the sea and possesses an unusually delicious body that is irresistible to nearby monsters. To ensure that she matures to the best condition, Shiori seeks to protect Hinako—all so that someday, she can devour every piece of her. What will become of Hinako’s feelings as this looming unjust death closes in on her…?\n<BR><BR>\n(Source: Yen Press)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx123777-x2jv05rFTQ1O.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx123777-x2jv05rFTQ1O.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx123777-x2jv05rFTQ1O.jpg","color":"#e41a28"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/123777/","mal":"https://myanimelist.net/manga/129656/"};
export const m150492 = {"id":150492,"title":{"romaji":"Wasureenu Majo no Monogatari","english":null},"description":"In a world where \"today\" is repeated over and over again, only \"I\" remembered each day.\nThe events of \"today\" can be whimsical, and when \"today\" was over, everything will be reset,\nand the “today” that comes tomorrow will rarely be the same.\n<BR><BR>\nAyaka Aizawa lived with such a curse, until one day.<BR>\n\"Your name is Ayaka Aizawa? My name is Michiru Inaba, nice to meet you.\"\n<BR><BR>\nAfter that, Misuzu will continue to connect with her on the next “today.”<BR>\nFor the first time in her life, in the repeated “today”, she could have a relationship with a friend.<BR>\nWhile being perplexed by the distance shrinking little by little, the feeling of \"I\" was quietly changing...<BR>\nAround the time Ayaka became aware of her uncontrollable emotions, something happening between she and her \"girl friend.\"<BR>\nA slightly fantastical story about the clumsy feelings between \"I\" and \"girl friend\", unsure whether it's love or friendship.\n<BR><BR>\n(Source: MangaUP!, translated)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx150492-oaWkn7RReSY3.png","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx150492-oaWkn7RReSY3.png","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx150492-oaWkn7RReSY3.png","color":null},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/150492/","mal":"https://myanimelist.net/manga/170142/"};
