export const m161477 = {"id":161477,"title":{"romaji":"Zenbu Kowashite Jigoku de Aishite","english":null},"description":"Kurumi Yoshizawa is the student council president with excellent grades and good manners... but in private, she is stressed by her strict mother and the excessive expectations of her teachers.\n<BR><BR>\nOne day, Yoshizawa is asked by her homeroom teacher to check on her truant classmate Naoi, but Naoi only scorns Yoshizawa, as if seeing through her true feelings. On the verge of a mental breakdown, Yoshizawa makes a clumsy attempt at shoplifting, but Naoi records the whole thing...\n<BR><BR>\nThis is a violent coming-of-age story about two people struggling in everyday life with no escape.\n<BR><BR>\n(Source: Ichijin Plus, translated)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx161477-keQWQuZ2uP6B.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx161477-keQWQuZ2uP6B.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx161477-keQWQuZ2uP6B.jpg","color":null},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/161477/","mal":"https://myanimelist.net/manga/157273/"};
export const m135802 = {"id":135802,"title":{"romaji":"Kyou wa Kanojo ga Inai kara","english":"My Girlfriend’s Not Here Today"},"description":"Pent up and tired of her apathetic girlfriend, Asahina Yuni turns to an anonymous online account to let it all out. It’s just another day of doomscrolling after class when Asahina gets swept away in conversation with the beautiful, outgoing Taki. When Taki turns out to be following Asahina’s private account, it’s cute…right? Taki would never blackmail Asahina…right? With every new lie, the web of secrets and erotic desire grows ever-tighter!\n<BR><BR>\n(Source: Seven Seas Entertainment)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx135802-yteNzPoHsCre.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx135802-yteNzPoHsCre.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx135802-yteNzPoHsCre.jpg","color":null},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/135802/","mal":"https://myanimelist.net/manga/137840/"};
export const m110670 = {"id":110670,"title":{"romaji":"Watashi wo Hitorijime ni Shite","english":null},"description":"Two short stories by Kaneko Aru.<br><br>\n1. <b>Himitsu to Mitsumete</b> (ひみつとみつめて)<br>\n\"I will treasure this forever\" - classmates Hina and Mitsuki are secretly dating. Hina wants to have the popular Mitsuki all to herself, as a present she gave Mitsuki and herself matching keystraps. When Mitsuki touched the keystrap, she felt something hard within it. This is... a wiretap!?\n<br><br>\n2. <b>Kawarukoto</b> (かわること)<br>\nMonths and years pass by and various things change between them. But, some things didn't change. A story of two students who are childhood friends.","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx110670-J2MJV5ILDdil.png","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx110670-J2MJV5ILDdil.png","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx110670-J2MJV5ILDdil.png","color":"#f1a178"},"chapters":2,"volumes":1,"anilist":"https://anilist.co/manga/110670/","mal":"https://myanimelist.net/manga/null/"};
