export const m120054 = {"id":120054,"title":{"romaji":"Kono Ai wo Owarasete Kurenai ka","english":null},"description":"Yuzu is Hayami Madoka's ardent fan. Having no friends or family that care for her, Madoka is her only solace. Being that Sachiko is Madoka's best friend, she is Yuzu's most hated existence. To vent, she opens a secret account where she posts malicious comments about Sachiko. When she discovers this, she instead attempts to befriend Yuzu and offers her a chance to talk to Madoka. However, an accident occurs and they end up switching bodies with Sachiko being left in coma.\n","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx120054-bxdaB4hnlzCH.png","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx120054-bxdaB4hnlzCH.png","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx120054-bxdaB4hnlzCH.png","color":null},"chapters":35,"volumes":4,"anilist":"https://anilist.co/manga/120054/","mal":"https://myanimelist.net/manga/147200/"};
