export const m136109 = {"id":136109,"title":{"romaji":"Amayo no Tsuki","english":"The Moon on a Rainy Night"},"description":"One day, while rushing to a piano lesson, a girl named Saki collides with someone on the street. As Saki collects herself, the stranger picks up the sheet music Saki dropped, hands it to Saki together with a band-aid, and continues on her way—all without saying a word. Saki is left wondering about the identity of the tall, lovely stranger, only to discover the next day that she is one of her classmates at her new high school. The girl’s name is Kanon, and though she is hearing impaired, she refuses any kind of support or “special treatment” from her teachers or classmates. Over the course of the year, Saki slowly grows closer to Kanon and begins to chip away at her cold exterior.\n<br><br>\n(Source: Kodansha USA)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx136109-2pm7Xx1pFrR2.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx136109-2pm7Xx1pFrR2.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx136109-2pm7Xx1pFrR2.jpg","color":"#e45043"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/136109/","mal":"https://myanimelist.net/manga/142310/"};
export const m117620 = {"id":117620,"title":{"romaji":"Kimi to Tsuzuru Utakata","english":"The Summer You Were There"},"description":"Shizuku is a shy girl who hardly talks to other people. Instead, she loses herself in creative writing, crafting a novel that she never plans to show anyone. But when Kaori–Shizuku’s cute, popular classmate–gets her hands on Shizuku’s manuscript, everything changes. Kaori is a huge fan, and suggests that Shizuku can get inspiration for her writing if the two of them start dating! Can these very different young ladies create their own love story together?\n<br><br>\n(Source: Seven Seas Entertainment)","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx117620-cyvy8nO9GLm8.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx117620-cyvy8nO9GLm8.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx117620-cyvy8nO9GLm8.jpg","color":null},"chapters":32,"volumes":6,"anilist":"https://anilist.co/manga/117620/","mal":"https://myanimelist.net/manga/128365/"};
