export const m111970 = {"id":111970,"title":{"romaji":"Sayonara Rose Garden","english":"Goodbye, My Rose Garden"},"description":"England, the early 1900s. Alice, a young noblewoman, has a Japanese maid named Hanako working in her household. The two have a fairly typical relationship…until the day Alice begs Hanako to kill her. As Hanako tries to figure out why her mistress would make such a terrible request, she and Alice grow closer until an entirely new feeling begins to blossom between them.<br><br>(Source: Seven Seas Entertainment)<br><br>\n<i>Note: Chapter count includes 1 extra.</i>\n\n","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx111970-hpmPgZprtvI4.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx111970-hpmPgZprtvI4.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx111970-hpmPgZprtvI4.jpg","color":"#f1506b"},"chapters":17,"volumes":3,"anilist":"https://anilist.co/manga/111970/","mal":"https://myanimelist.net/manga/122575/"};
