export const m143535 = {"id":143535,"title":{"romaji":"Iberis no Hanayome","english":null},"description":"A wedding planner is just counting the days until her wedding, but she's just not feeling it. One night, she catches one of her clients, a bride to be, in a compromising and morally-compromising situation. And yet... there's just something alluring about this woman that catches her off guard.","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx143535-uvWc8t18hia6.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx143535-uvWc8t18hia6.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx143535-uvWc8t18hia6.jpg","color":"#f1e4c9"},"chapters":11,"volumes":2,"anilist":"https://anilist.co/manga/143535/","mal":"https://myanimelist.net/manga/145948/"};
export const m178728 = {"id":178728,"title":{"romaji":"Kimi Meku Yoru ni Kogarete","english":null},"description":"At Seiruri Girls School, there are two opposing factions: the \"Ruri Gumi,\" made up of respectable young ladies, and the \"Ai Gumi,\" made up of delinquents with questionable behavior.\n<BR><BR>\nAmong the Ai-gumi students, Nanase Mitsuki is the one most feared by the Ruri-gumi because of her fierce appearance.\nNanase has mixed feelings about her reputation, until one night when she sees one of the good girls, Yuka Hosho, wandering the streets alone at night…?\n<BR><BR>\nThis is a sweet and fleeting love story between two people who can only meet at night.\n<BR><BR>\n(Source: Comic Amble, translated)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx178728-Y1x2qIK8ufJb.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx178728-Y1x2qIK8ufJb.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx178728-Y1x2qIK8ufJb.jpg","color":"#5d86f1"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/178728/","mal":"https://myanimelist.net/manga/null/"};
export const m114970 = {"id":114970,"title":{"romaji":"Goukaku no Tame no! Yasashii Sankaku Kankei Nyuumon","english":null},"description":"In pursuit of Akira, the senpai she admires and loves, Mayuki Yukishita does her best to pass her exams and get into the same school as her, only to end up dead last on a mock test. To help her out, her mom gets her a private tutor, Rin Mochizuki, a polyamorous girl from the same school as her senpai who ends up taking Mayuki's first kiss, and who is closer to Akira than Mayuki knows...","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx114970-i7kL6VgDrKgM.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx114970-i7kL6VgDrKgM.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx114970-i7kL6VgDrKgM.jpg","color":"#e45078"},"chapters":11,"volumes":2,"anilist":"https://anilist.co/manga/114970/","mal":"https://myanimelist.net/manga/128747/"};
