export const m120968 = {"id":120968,"title":{"romaji":"Moshi, Koi ga Mieta Nara","english":"If You Could See Love"},"description":"Mei Haruno was born with the troublesome ability of being able to see pink arrows indicating who people were in love with. In order to escape, she chooses to enroll in an all-girls’ boarding school in the hopes of never getting involved in romance again…only to discover not one, but two arrows directed right at her!\n<br><br>\n(Source: Yen Press)\n\n<br><br>\n<i>Note: Includes one bonus chapter.<i>","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx120968-jto7ApziffkO.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx120968-jto7ApziffkO.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx120968-jto7ApziffkO.jpg","color":"#e45086"},"chapters":16,"volumes":3,"anilist":"https://anilist.co/manga/120968/","mal":"https://myanimelist.net/manga/131570/"};
export const m155090 = {"id":155090,"title":{"romaji":"Yukidoke to Agapanthus","english":null},"description":"Natsuki is the \"prince\" of an all-girls school, who excels at both sports and academics, and even has her own fan club.\nBut even though Natsuki is admired and praised by everyone, ......she feels unsatisfied with her life for some reason.\n<Br><Br>\nThen, a new transfer student, Shun, arrives.<BR>\nUnlike the other girls, Shun does not treat Natsuki like a \"prince,\" but as a \"friend.\"<BR>\nAt first, Natsuki feels uncomfortable with her new \"friend.\"<BR>\nBut Shun's innocent smile and cheerful personality is making her heart flutter...?\n<BR><BR>\n(Source: Kadokawa, translated)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx155090-yp4SvD0UCggm.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx155090-yp4SvD0UCggm.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx155090-yp4SvD0UCggm.jpg","color":"#1aaed6"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/155090/","mal":"https://myanimelist.net/manga/152592/"};
