export const m113658 = {"id":113658,"title":{"romaji":"Ame demo Hare demo","english":null},"description":"Nekozaki Ren abused her powers as school council secretary to secretly set up a Miko Club in her school’s abandoned shrine. All of this so she could spend time with her crush, Yamada Mikoto, after school. But this wasn’t meant to last. Before long some people caught wind of their little club site, and with the school’s club building fully occupied, they saw themselves fit to use the shrine for their own club activities instead! Will Ren be able to reclaim her paradise?\n<br><br>\n<i>Note: Includes 3 extra chapters.</i>","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx113658-1nRH37J29MoY.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx113658-1nRH37J29MoY.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx113658-1nRH37J29MoY.jpg","color":"#f1bb50"},"chapters":22,"volumes":3,"anilist":"https://anilist.co/manga/113658/","mal":"https://myanimelist.net/manga/125760/"};
export const m69959 = {"id":69959,"title":{"romaji":"Toumei Ningen no Hone","english":null},"description":"At first glance, the family of Kinomiya Aya may seem quite ordinary: loving mother and father and a kind elder brother, however, appearances can be deceiving—Aya's father constantly beats her mother, scolds them for the slightest \"transgressions,\" and commits other inappropriate deeds. Her brother spends all of his time selfishly ignoring what's right in front of him in favour of enjoying himself. Her mother is enduring it all for her children, and both mother and daughter live in constant fear of Aya's father. Because of all this, Aya envies ordinary families and the children who enjoy them.<br><br>\n\nOne day, after witnessing a quarrel between father and mother turn violent, Aya experiences a great deal of stress, due to which she gains the ability to turn invisible. At first, the girl indulged in her superpowers, but eventually she makes a decision that will probably make her blame herself for the rest of her life...\n","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/nx69959-4fcORMubUWhh.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/nx69959-4fcORMubUWhh.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/nx69959-4fcORMubUWhh.jpg","color":"#e4505d"},"chapters":22,"volumes":4,"anilist":"https://anilist.co/manga/69959/","mal":"https://myanimelist.net/manga/109907/"};
