export const m104403 = {"id":104403,"title":{"romaji":"Kaijuu Iro no Shima","english":null},"description":"Without a single friend, middle schooler Chigawa Kon lives on a small island and laments that she hasn't \"fallen in love\" yet, unlike her classmates. She often plays by \"the Hole\", a cave near the sea where a man-eating monster lives, according to folk tales.\n<br><br>\nOne day, as she meets with another girl who accidentally drops her smartphone in the sea, they fall from a cliff together but miraculously survive. It turns out Furuka is also all alone.\n","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx104403-ICScsUxSCEiL.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx104403-ICScsUxSCEiL.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx104403-ICScsUxSCEiL.jpg","color":"#004393"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/104403/","mal":"https://myanimelist.net/manga/116210/"};
