export const m169154 = {"id":169154,"title":{"romaji":"Futsuu to Bakemono","english":null},"description":"Ito-san is a girl with a communication disorder, who longs to be \"normal.\"\nShe has a crush on her classmate Takahashi-san, who is reserved but gets along with everyone.\nOne day, however, Ito discovers Takahashi's true identity!\nTakahashi-san is actually a monster who hides by mimicking human beings.\nIto decides to learn how to act like a \"normal\" human being from the monster girl Takahashi.\nWill these girls ever be be able to fit in?\n<BR><BR>\n(Source: ComicWalker, translated)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx169154-KuCbQ7tIEY89.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx169154-KuCbQ7tIEY89.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx169154-KuCbQ7tIEY89.jpg","color":"#e4505d"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/169154/","mal":"https://myanimelist.net/manga/168988/"};
