export const m178235 = {"id":178235,"title":{"romaji":"Sugar Girl Drip","english":null},"description":"Marie, a sparkling college girl and online influencer with an overflowing need for approval, gets a part-time job at a diner cafe because she likes the uniform. There, she meets Aki, a minefield girl who's trouble, and it's going to change their lives forever...? The overdose of desire begins, in a neon-lit city that never sleeps! \n<BR><BR>\n(Source: Comic Days, translated)","format":"MANGA","status":"RELEASING","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx178235-22JGNqMBjIxB.png","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx178235-22JGNqMBjIxB.png","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx178235-22JGNqMBjIxB.png","color":"#f128a1"},"chapters":null,"volumes":null,"anilist":"https://anilist.co/manga/178235/","mal":"https://myanimelist.net/manga/170695/"};
export const m157512 = {"id":157512,"title":{"romaji":"Naraku no Hanazono","english":null},"description":"Meari, a girl who moved from Tokyo to the countryside, meets the mysterious girl Colin in a \"secret garden\" up in the mountains. With nowhere to go, they share a \"secret\" in the garden that they can't tell anyone. They didn't realize the consequences of what they did.......\n<BR><BR>\n(Source: Yuri-Hime, translated)","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx157512-CGpEeQyEsYDC.jpg","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx157512-CGpEeQyEsYDC.jpg","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx157512-CGpEeQyEsYDC.jpg","color":"#f1e428"},"chapters":12,"volumes":2,"anilist":"https://anilist.co/manga/157512/","mal":"https://myanimelist.net/manga/160681/"};
export const m110278 = {"id":110278,"title":{"romaji":"Twenty Lillies","english":null},"description":"1-3. <b>Heart no Okurimono</b> (ハートのおくりもの)<br>\nShiro had a weak heart, so she had been bedridden since she was little. A girl from her neighborhood named Kuro would always visit her and keep her company throughout the years. Eventually, Shiro's condition got to the point where she needed a transplant, or else she would die. Kuro then offers her heart to Shiro, and has hers replaced by a mechanical one. This story is about them adjusting to their new hearts and to their feelings for each other.<br><br>\n4-6. <b>Futatsu no Rasen</b> (ふたつのラセン)<br>\nThrough the use of her research in parthenogenesis genetics, Kita-san from the Sciences and Mathematics Department had been able to have a child with a star athlete in the Physical Education Department, Minami-san. This is the story of how their child and family came to be.<br><br>\n7-9. <b>Risutaato wa Zero kara</b> (リスタートはゼロから)<br>\n…“She” is not the only one. A young girl, who suffered from a severe case of identity disorder, was abandoned by her parents and came to live together with her attending physician. Despite their peculiar relationship, the two were leading a quiet and comfortable life, until...<br><br>\n<b>Included one-shots:</b><br>\nVolume 2: Perfect Communication, I Wish You, Yuru Daizai","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx110278-gnpTszgFmbKN.png","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx110278-gnpTszgFmbKN.png","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx110278-gnpTszgFmbKN.png","color":"#a1e435"},"chapters":12,"volumes":2,"anilist":"https://anilist.co/manga/110278/","mal":"https://myanimelist.net/manga/158434/"};
