export const m110604 = {"id":110604,"title":{"romaji":"Kimi no Kureru Mazui Ame","english":null},"description":"A collection of dark and somewhat strange stories.\n<br><br>\n1. <b>Kimi no Kureru Mazui Ame</b> (君のくれるまずい飴, Bad Candy You Give Me)<br>\nTwo girls and candy.\n<br><br>\n2. <b>Oyogu Hana</b> (泳ぐ花, Swimming Flowers)<br>\nA city girl feels out of place in a small fishing town.\n<br><br>\n3. <b>Tekisha Seizon</b> (適者生存, Survival of the Fittest); COMITIA117<br>\nA girl sneaks food to feed her friend turned fish.\n<br><br>\n4. <b>Yasashii Kanoke</b> (やさしい棺桶, A Tender Casket)<br>\nWhen your best and oldest friend comes back from the dead and lives in your room.\n<br><br>\n5. <b>Haha to Ane</b> (母と姉, Mother and Sister); COMITIA115<br>\nA girl struggles with her identity and her relationship with her sister after the death of their mother.\n<br><br>\n6. <b>Nishi ni Shizumu</b> (西に沈む, Sets in the West); Doujinshi Anthology, JUN Vol.2 (COMITIA116)<br>\nWhen I wake up, I see another me.\n<br><br>\n7. <b>Anata no Koto wa Suki Nandakedo</b> (あなたのことは好きなんだけど, Much as I Love You); Twitter (2015-10-19)<br>\nThe pretty one and the sweet one.\n<br><br>\n8. <b>Chousekiryoku</b> (潮汐力, Tidal Force)<br>\nDid she just see the moon crash?\n<br><br>\n9. <b>Sayonara</b> (さよなら, Goodbye)<br>\nSomebody drew a rectangle in pencil on my desk.\n<br><br>\n10. <b>Sumu Ma</b> (棲む魔, Where Demons Dwell)<br>\nHalf-eaten fish start washing ashore after a group of girls disappeared, presumed dead.\n<br><br>\n11. <b>Rikyou</b> (離郷, Leaving Home); Twitter (2018-6-30)<br>\nA girl leaves her hometown.\n<br><br>\n12. <b>Haru no Sanagi</b> (春の蛹, Spring Pupa); COMITIA112<br>\nThe scent of peach blossoms conjures up memories of high school.\n<br><br>\n(Source: Lovely Strange Dark)\n","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx110604-Bp3pNP9WM3V9.png","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx110604-Bp3pNP9WM3V9.png","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx110604-Bp3pNP9WM3V9.png","color":null},"chapters":12,"volumes":1,"anilist":"https://anilist.co/manga/110604/","mal":"https://myanimelist.net/manga/121280/"};
