export const m106974 = {"id":106974,"title":{"romaji":"Kimi ni Sukitte Iwasetai","english":null},"description":"A collection of Takeshima Eku's short yuri stories.\n<br><br>\n1. <b>Kimi ni Suki tte Iwasetai</b> (君に好きっていわせたい)<br>\nKei and Misaki have been best friends since they were kids. One day, Misaki confesses her feelings for Kei and the two of them start going out. To Kei, everything seems to be going alright but to Misaki...\n<br><br>\n2. <b>Kimi ga Suki tte Ittekita</b> (君が好きっていってきた)<br>\nContinuation of <i>Kimi ga Suki tte Ittekita.</i>\n<br><br>\n3. <b>Uchi no Neko ga Kawaii Youjo ni Naru Nante!</b> (ウチの猫が可愛い幼女になるなんてっ！)\n<br><br>\n4. <b>Super Maid ni Omakase Kudasai!</b> (スーパーメイドにお任せください!)<br>\nKuro's mistress makes an impossible request to her.\n<br><br>\n5. <b>NEET Na Oneesan Hiroimashita.</b> (ニートなお姉さん拾いました。)<br>\nAn office lady encounters a homeless girl on the street and reluctantly lets her stay at her place.\n<br><br>\n6. <b>Miyuri no Shiro-chan</b> (みゆりのしろちゃん)<br>\nMiyuri has made a snowman every winter. One year she puts her special scarf the one she made. A few days later, Shiro arrives at her door, wearing her scarf.\n<br><br>\n7. <b>Hen Ai</b> (へんあい)","format":"MANGA","status":"FINISHED","isAdult":false,"coverImage":{"extraLarge":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/large/bx106974-HQ0RfCydbqj0.png","medium":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/small/bx106974-HQ0RfCydbqj0.png","large":"https://s4.anilist.co/file/anilistcdn/media/manga/cover/medium/bx106974-HQ0RfCydbqj0.png","color":null},"chapters":7,"volumes":1,"anilist":"https://anilist.co/manga/106974/","mal":"https://myanimelist.net/manga/116410/"};
